import logo from "./logo.svg";
import "./App.css";
import P1 from "./p1";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import { Menu } from "antd";
const { SubMenu } = Menu;

const items = [
  {
    key: "sub1",
    label: "Navigation One",
    children: [
      {
        key: "g1",
        label: "Item 1",
        type: "group",
        children: [
          {
            key: "1",
            label: "Option 1",
          },
          {
            key: "2",
            label: "Option 2",
          },
        ],
      },
      {
        key: "g2",
        label: "Item 2",
        type: "group",
        children: [
          {
            key: "3",
            label: "Option 3",
          },
          {
            key: "4",
            label: "Option 4",
          },
        ],
      },
    ],
  },
  {
    key: "sub2",
    label: "Navigation Two",
    children: [
      {
        key: "5",
        label: "Option 5",
      },
      {
        key: "6",
        label: "Option 6",
      },
      {
        key: "sub3",
        label: "Submenu",
        children: [
          {
            key: "7",
            label: "Option 7",
          },
          {
            key: "8",
            label: "Option 8",
          },
        ],
      },
    ],
  },
  {
    type: "divider",
  },
  {
    key: "sub4",
    label: "Navigation Three",
    children: [
      {
        key: "9",
        label: "Option 9",
      },
      {
        key: "10",
        label: "Option 10",
      },
      {
        key: "11",
        label: "Option 11",
      },
      {
        key: "12",
        label: "Option 12",
      },
    ],
  },
  {
    key: "grp",
    label: "Group",
    type: "group",
    children: [
      {
        key: "13",
        label: "Option 13",
      },
      {
        key: "14",
        label: "Option 14",
      },
    ],
  },
];

function App() {
  return (
    <Router>
      <Menu mode="vertical">
        <Menu.Item key="home">
          <Link to="/home">Home</Link>
        </Menu.Item>
        <SubMenu key="sub1-2" title="Submenu 2">
          <Menu.Item key="5">Option 5</Menu.Item>
          <Menu.Item key="6">Option 6</Menu.Item>
        </SubMenu>
        <Menu.Item key="user/profile">
          <Link to="/user/profile">Profile</Link>
        </Menu.Item>
        <Menu.Item key="user/settings">
          <Link to="/user/settings">Settings</Link>
        </Menu.Item>

        <Menu.Item key="settings">
          <Link to="/settings">Settings</Link>
        </Menu.Item>
      </Menu>
      <Routes>
        {/* <Route exact path="/" element={<Home />} /> */}
        <Route path="/p1" element={<P1 />} />
      </Routes>
    </Router>
  );
}

export default App;
